import { Outlet } from "react-router-dom";
import "./App.css";
import "./assets/css/grid.css";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react";

function App() {
  const navigate = useNavigate();
  useEffect(() => {
    navigate("login");
    const id = setInterval(() => {
      console.log("count");
    }, 1000);
    return (clearInterval(id));
  });
  return (
    <div className="App">
      <Outlet />
    </div>
  );
}
export default App;
